text:
این کتاب و این نوشته کنارش ازاستاد، یادگاری #مصاف به ماست.اون آخوند به این موسسه میگه جادوگری...
هرچندمدتهاست توفیق خدمت به امام زمان به خاطر گرفتاری ازم سلب شده، ولی هنوز وقتی این تخریب ها رو می بینم مصمم تر میشم که هرجوری در توانم هست کمک کنم به مسیر عزیزان مصاف.
@_Mahdiyar313

آقای اژه‌ای!
اگر فرد هتاک به این مادر ایرانی در اسرع وقت دستگیر و به سزای عمل شنیعش نرسد، به هفته نرسیده شاهد درگیری‌های خیابانی و حتی ترور شهروندان خیلی بدتر از سال‌های اول دهه ۶۰ خواهیم بود. 
@MKeshtdar
